import React from 'react';
import { NavLink } from 'react-router-dom';

export const Cart = () => (
  <NavLink className="SectionRight SectionRight-Cart" to="/cart">
    <div className="SectionRight-Content">
      <img
        className="SectionRight-Link"
        src="./img/cart.svg"
      />
      <span className="SectionRight-Count">{}</span>
    </div>
  </NavLink>
)
